CREATE DATABASE heartandsole_db;

USE heartandsole_db;

GRANT ALL PRIVILEGES ON heartandsole_db.* TO 'webapp'@'%';

FLUSH PRIVILEGES;

DROP TABLE IF EXISTS coaches;

CREATE TABLE coaches (
	coach_id INT NOT NULL,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	b_day VARCHAR(15) NOT NULL,
	city VARCHAR(50) NOT NULL,
	usstate VARCHAR(50) NOT NULL,
	gender VARCHAR(50) NOT NULL,
	email VARCHAR(50) NOT NULL,
	CONSTRAINT coachespk PRIMARY KEY (coach_id)
);


DROP TABLE IF EXISTS teams;

CREATE TABLE teams (
	team_id INT NOT NULL,
	team_name VARCHAR(500) NOT NULL,
	gender_desc VARCHAR(5) NOT NULL,
	coach_id INT NOT NULL,
	CONSTRAINT teamspk PRIMARY KEY (team_id),
	CONSTRAINT teamsfk_1
        FOREIGN KEY (coach_id) REFERENCES coaches (coach_id)
);


DROP TABLE IF EXISTS runners;

CREATE TABLE runners (
	runner_id INT NOT NULL ,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	b_day VARCHAR(15) NOT NULL,
	gender VARCHAR(50) NOT NULL,
	city VARCHAR(50) NOT NULL,
	usstate VARCHAR(50) NOT NULL,
	email VARCHAR(50) NOT NULL,
	team_id INT,
	CONSTRAINT runnerspk PRIMARY KEY (runner_id),
	CONSTRAINT runnersfk_1
        FOREIGN KEY (team_id) REFERENCES teams (team_id)
);


DROP TABLE IF EXISTS runnersjournals;

CREATE TABLE runnersjournals (
	journal_id VARCHAR(10) NOT NULL,
	runner_id INT NOT NULL,
	CONSTRAINT rjournalspk PRIMARY KEY (journal_id),
    CONSTRAINT rjournalsfk_1
        FOREIGN KEY (runner_id) REFERENCES runners (runner_id)
);


DROP TABLE IF EXISTS journalentries;

CREATE TABLE journalentries (
	entry_id INT AUTO_INCREMENT NOT NULL,
	journal_id VARCHAR(10),
	entry_title TEXT NOT NULL,
	entry TEXT NOT NULL,
	entry_time VARCHAR(50),
	entry_date VARCHAR(15),
	mins_ran DECIMAL(5,2),
	miles_ran DECIMAL(4,2),
	route VARCHAR(10000),
	CONSTRAINT jentriespk PRIMARY KEY (entry_id),
	CONSTRAINT jentriesfk_1
        FOREIGN KEY (journal_id) REFERENCES runnersjournals (journal_id)
);




DROP TABLE IF EXISTS organizations;

CREATE TABLE organizations (
	organization_id VARCHAR(4) NOT NULL,
	org_name VARCHAR(34) NOT NULL,
	org_number VARCHAR(50) NOT NULL,
	city VARCHAR(50) NOT NULL,
	usstate VARCHAR(50) NOT NULL,
	CONSTRAINT orgpk PRIMARY KEY (organization_id)
);


DROP TABLE IF EXISTS raceorganizers;

CREATE TABLE raceorganizers (
	organizer_id INT NOT NULL,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	gender VARCHAR(50) NOT NULL,
	city VARCHAR(50) NOT NULL,
	usstate VARCHAR(50) NOT NULL,
	email VARCHAR(50) NOT NULL,
	organization_id VARCHAR(4) NOT NULL,
	CONSTRAINT organizerspk PRIMARY KEY (organizer_id),
	CONSTRAINT organizersfk_1
        FOREIGN KEY (organization_id) REFERENCES organizations (organization_id)
);



DROP TABLE IF EXISTS races;

CREATE TABLE races (
	race_id INT NOT NULL,
	race_name VARCHAR(124) NOT NULL,
	race_city VARCHAR(13) NOT NULL,
	race_state VARCHAR(50) NOT NULL,
	race_date VARCHAR(15) NOT NULL,
	race_desc TEXT NOT NULL,
	start_time VARCHAR(7) NOT NULL,
	organizer_id INT NOT NULL,
	CONSTRAINT racespk PRIMARY KEY (race_id),
	CONSTRAINT racesfk_1
        FOREIGN KEY (organizer_id) REFERENCES raceorganizers (organizer_id)
);



DROP TABLE IF EXISTS volunteers;

CREATE TABLE volunteers (
	volunteer_id INT NOT NULL,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	gender VARCHAR(50) NOT NULL,
	age INT NOT NULL,
	job_desc TEXT NOT NULL,
	race_id INT NOT NULL,
	CONSTRAINT volpk PRIMARY KEY (volunteer_id),
	CONSTRAINT volfk_1
        FOREIGN KEY (race_id) REFERENCES races (race_id)
);


DROP TABLE IF EXISTS services;

CREATE TABLE services (
    service_id INT NOT NULL,
	company_name VARCHAR(50) NOT NULL,
	service_desc VARCHAR(500) NOT NULL,
	cost INT NOT NULL,
	hours_hired INT NOT NULL,
	race_id INT NOT NULL,
	CONSTRAINT servicespk PRIMARY KEY (service_id),
	CONSTRAINT servicesfk_1
        FOREIGN KEY (race_id) REFERENCES races (race_id)
);



DROP TABLE IF EXISTS coachesplanners;

create table coachesplanners (
	planner_id VARCHAR(50) NOT NULL,
	coach_id INT NOT NULL,
	CONSTRAINT cplannerspk PRIMARY KEY (planner_id),
	CONSTRAINT cplannersfk_1
        FOREIGN KEY (coach_id) REFERENCES coaches (coach_id)
);


DROP TABLE IF EXISTS practiceplans;

CREATE TABLE practiceplans (
	plan_id INT NOT NULL,
	planner_id VARCHAR(10) NOT NULL,
	prac_date VARCHAR(15) NOT NULL,
	prac_time VARCHAR(50) NOT NULL,
	prac_desc TEXT NOT NULL,
	attend_req VARCHAR(13) NOT NULL,
	CONSTRAINT pracplanspk PRIMARY KEY (plan_id),
	CONSTRAINT pracplansfk_1
        FOREIGN KEY (planner_id) REFERENCES coachesplanners (planner_id)
);


DROP TABLE IF EXISTS merchinvoices;

CREATE TABLE merchinvoices (
	invoice_id INT NOT NULL,
	invoice_date VARCHAR(15) NOT NULL,
	billing_city VARCHAR(50) NOT NULL,
	billing_state VARCHAR(50) NOT NULL,
	total VARCHAR(50) NOT NULL,
	company VARCHAR(50) NOT NULL,
	coach_id INT NOT NULL,
	CONSTRAINT merchpk PRIMARY KEY (invoice_id),
	CONSTRAINT merchfk_1
        FOREIGN KEY (coach_id) REFERENCES coaches (coach_id)
);


DROP TABLE IF EXISTS invoicelines;

CREATE TABLE invoicelines (
	invoicelineid INT NOT NULL,
	unit_price VARCHAR(50) NOT NULL,
	quantity INT NOT NULL,
	product_name VARCHAR(100) NOT NULL,
	invoice_id INT NOT NULL,
	CONSTRAINT invlinespk PRIMARY KEY (invoicelineid),
	CONSTRAINT invlinesfk_1
        FOREIGN KEY (invoice_id) REFERENCES merchinvoices (invoice_id)
);



DROP TABLE IF EXISTS individualentries;

CREATE TABLE individualentries (
    entry_id INT NOT NULL,
    runner_id INT NOT NULL,
    race_id INT NOT NULL,
    CONSTRAINT indivent_pk PRIMARY KEY (entry_id),
    CONSTRAINT indivent_fk1
        FOREIGN KEY (runner_id) REFERENCES runners (runner_id),
    CONSTRAINT indivent_fk2 
        FOREIGN KEY (race_id) REFERENCES races (race_id)
);


DROP TABLE IF EXISTS teamentries;

CREATE TABLE teamentries (
    entry_id INT AUTO_INCREMENT NOT NULL,
    team_id INT NOT NULL,
    race_id INT NOT NULL,
    CONSTRAINT teament_pk PRIMARY KEY (entry_id),
    CONSTRAINT teament_fk1 
        FOREIGN KEY (team_id) REFERENCES teams (team_id),
    CONSTRAINT teament_fk2
        FOREIGN KEY (race_id) REFERENCES races (race_id)
);



